DROP TABLE IF EXISTS intake;
DROP TABLE IF EXISTS requirement;
DROP TABLE IF EXISTS university;
DROP TABLE IF EXISTS course;

CREATE TABLE university(
   University VARCHAR(66) NOT NULL PRIMARY KEY
  ,Location   VARCHAR(29) NOT NULL
  ,Images     VARCHAR(150) NOT NULL
  ,Region     VARCHAR(16) NOT NULL
  ,Period     VARCHAR(139) NOT NULL
);
The University of Toronto Scarborough: September 2024 – December 2024');

CREATE TABLE requirement(
   Uni_Name VARCHAR(66) NOT NULL PRIMARY KEY
  ,GPA      NUMERIC(3,1) NOT NULL
  ,IELTS    NUMERIC(3,1) NOT NULL
  ,TOEFL    INTEGER 
  ,DET      INTEGER 
);

CREATE TABLE intake(
   GPA_Min                         NUMERIC(4,2) NOT NULL
  ,GPA_Max                         NUMERIC(4,2) NOT NULL
  ,TOEFL_Score_Min                 NUMERIC(4,1)
  ,TOEFL_Score_Max                 NUMERIC(4,1)
  ,IELTS_Score_Min                 NUMERIC(3,1)
  ,IELTS_Score_Max                 NUMERIC(3,1)
  ,Duolingo_English_Test_Score_Min INTEGER 
  ,Duolingo_English_Test_Score_Max INTEGER 
  ,Total_Students                  INTEGER  NOT NULL
  ,Uni_Name                        VARCHAR(66) NOT NULL
  ,Type_                            VARCHAR(20) NOT NULL
  ,Year_                            INTEGER  NOT NULL
  ,PRIMARY KEY(Uni_Name,Type_,Year_)
);


CREATE TABLE course(
   University VARCHAR(66) NOT NULL
  ,Course     VARCHAR(112) NOT NULL
);

